import React, { useEffect, useState } from 'react'

import { Container, CardDetail } from './styles'

const Cards: React.FC = props => {
  const [um, setUm] = useState('0')
  const [dez, setDez] = useState('0')
  const [vinte, setVinte] = useState('0')
  const [trinta, setTrinta] = useState('0')
  useEffect(() => {
    setUm({
      totalRendimento: props.lista[11].rendimento,
      total: props.lista[11].valorFinal
    })

    setDez({
      totalRendimento: props.lista[121].rendimento,
      total: props.lista[121].valorFinal
    })

    setVinte({
      totalRendimento: props.lista[241].rendimento,
      total: props.lista[241].valorFinal
    })

    setTrinta({
      totalRendimento: props.lista[241].rendimento,
      total: props.lista[241].valorFinal
    })
  }, [props.lista])

  return (
    <Container>
      <CardDetail>{um.totalRendimento}</CardDetail>
      <CardDetail>{dez.totalRendimento}</CardDetail>
      <CardDetail>{vinte.totalRendimento}</CardDetail>
      <CardDetail>{trinta.totalRendimento}</CardDetail>
    </Container>
  )
}

export default Cards
